import React, { Component } from 'react';

class AppBar extends Component {
    render() {
        return (
            <div>
                <img src="https://png.pngitem.com/pimgs/s/678-6781246_spacex-hd-png-download.png" />
            </div>
        );
    }
}

export default AppBar;
